Sephora Sale Haul

This is all the makeup I bought during the sale.  I used gift cards so I didn't spend much of my own money. The last time I shopped at Sephora was during the fall sale. I try to put everything I want on my wishlist & wait to get them on sale. It also gives me time to make better decisions. When I wait a few weeks/months before buying a product, I'm more satisfied with my purchases and don't need to return anything.

