2025 Project Pan Update 1

Finally updating my project pan after 2 months. So happy to share my progress. 

Rolling out
@fentybeauty cream bronzer "butta biscuit" ❌ - decluttered it bc it expired and my skin reacted

Products I want to finish
@elfcosmetics poreless putty primer - making good progress, it will take me a few months
@doseofcolors meet your hue foundation "110 light" - I've been working on this foundation for over a year, will I ever finish it lol
@lysbeautyofficial triple fix brightening concealer "lg3" - I started scraping the sides so I'n going to remove the stopper soon
@phytosurgence spectral shine "mirrored moonlight" - didn't use it much but I want to finish it this spring
@kajabeauty lip gloss "pink drink" - was mostly focusing on the Covergirl, will focus on it this spring
@covergirl yummy gloss "sunrise blush" - it's my purse lippie, using it often but there's so much product

Products I want to hit pan on
Phytosurgence blush balm "evaporate" - used it a few times, was mostly wearing pink blushes for winter
@colourpopcosmetics sss "a little quarky" - haven't reached for it 
@essencemakeup brighten up banana powder - used it a few times

Rolling in
@makeupbymario skin enhancer "light medium" - goal: finish 

My goal is to update by the end of the semester/the end of my masters 🎉

The Covergirl gloss will be done by next update. The Lys concealer could be done too. 

How's your project pan going?

